import './TwoPeople.css'


export const TwoPeople = () => {
    return (
        <div><div className='people-container'>
        </div>
            <div className='people-background-image'>
                <img src={require('../assets/trees.jpeg')} alt="" />
            </div>
        </div>
    )
}
